import React from 'react'

export default function Card(props) {
    return (
        <div style = {{width: '300px', height: '500px',border: '1px solid',textAlign: 'center',padding: '10px 0'}}>
            <h2><b>Full name: </b>{props.name}</h2>
        </div>
    )
}
